import React from 'react';
import CustomButton from './../Button/CustomButton';

const PostItem = (props) => {
	
	return (
		<form>
			<div>
				<h1>{props.post.title}</h1>
			<span>{props.post.body}</span>
			</div>
			<CustomButton>Удалить</CustomButton>
		</form>
	);
}

export default PostItem;
